      <style>
            body {
                  margin: 0;
                  padding: 0;
                  box-sizing: border-box;
            }

            body * {
                  margin: 0;
                  padding: 0;
                  box-sizing: border-box;
            }

            main {
                  display: flex;
                  flex-direction: column;
                  height: 100vh;
            }

            header {
                  position: relative;
                  width: 100%;
                  max-width: 100%;
                  background-color: #000;
            }

            header .content-wrapper {
                  display: flex;
                  align-items: center;
                  justify-content: space-between;
                  max-width: 100%;
                  width: 100%;
                  padding: 15px 20px 15px 16px;
            }

            .logo-header {
                  max-height: 50px;
                  margin-right: 40px;
            }

                  display: inline-flex;
                  align-items: center;
                  position: relative;
                  height: 40px;
                  padding: 10px 32px;
                  color: #DFDFDF;
                  text-align: center;
                  font-family: 'Montserrat', sans-serif;
                  font-size: 16px;
                  font-weight: 600;
                  line-height: 24px;
                  border: 1px solid #DFDFDF;
                  background: transparent;
                  text-decoration: none;
                  cursor: pointer;
                  transition: .2s ease-in-out;
            }
